function loadImgSRC(){var t="data-src";(window.innerWidth||document.documentElement.clientWidth)<769&&(t="mobile-data-src");for(var e=document.getElementsByTagName("img"),n=0;n<e.length;n++){var d=e[n].getAttribute(t)||e[n].getAttribute("data-src");d&&e[n].setAttribute("src",d)}}window.addEventListener("load",function(){loadImgSRC()},!1),window.addEventListener("resize",function(){loadImgSRC()},!1);